    <title>Memory Game</title>
    <style>
        html {
            width: 100%;
            height: 100%;
            background: linear-gradient(325deg,  #03001e 0%,#0044ff 0%,#00ccff 50%, #fdeff9 100%);
            font-family: Arial, Helvetica, sans-serif;
            overflow: hidden;
        }
        .game {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
        }
        .controls {
            display: flex;
            gap: 20px;
            margin-bottom: 20px;
        }
        button {
            background: #282A3A;
            color: #FFF;
            border-radius: 5px;
            padding: 10px 20px;
            border: 0;
            cursor: pointer;
            font-family: Arial, Helvetica, sans-serif;
            font-size: 18pt;
            font-weight: bold;
        }
        .disabled {
            color: #757575;
        }
        .stats {
            color: #FFF;
            font-size: 14pt;
            font-weight: bold;
        }
        .board-container {
            position: relative;
        }
        .board,
        .win {
            border-radius: 5px;
            box-shadow: 0 25px 50px rgb(33 33 33 / 25%);
            background: linear-gradient(135deg,  #03001e 0%,#0044ff 0%,#00ccff 50%, #fdeff9 100%);
            transition: transform .6s cubic-bezier(0.4, 0.0, 0.2, 1);
            backface-visibility: hidden;
        }
        .board {
            padding: 20px;
            display: grid;
            grid-template-columns: repeat(4, auto);
            grid-gap: 20px;
        }
        .board-container.flipped .board {
            transform: rotateY(180deg) rotateZ(50deg);
        }
        .board-container.flipped .win {
            transform: rotateY(0) rotateZ(0);
        }
        .card {
            position: relative;
            width: 100px;
            height: 100px;
            cursor: pointer;
        }
        .card-front,
        .card-back {
            position: absolute;
            border-radius: 5px;
            width: 100%;
            height: 100%;
            background: #282A3A;
            transition: transform .6s cubic-bezier(0.4, 0.0, 0.2, 1);
            backface-visibility: hidden;
        }
        .card-back {
            transform: rotateY(180deg) rotateZ(50deg);
            font-size: 28pt;
            user-select: none;
            text-align: center;
            line-height: 100px;
            background: #FDF8E6;
        }
        .card.flipped .card-front {
            transform: rotateY(180deg) rotateZ(50deg);
        }
        .card.flipped .card-back {
            transform: rotateY(0) rotateZ(0);
        }
        .win {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            text-align: center;
            background: #FDF8E6;
            transform: rotateY(180deg) rotateZ(50deg);
        }
        .win-text {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-size: 21pt;
            color: #282A3A;
        }
        .highlight {
            color: #7303c0;
        }
    </style>
</head>
